COMMIT;

-- ----------------------------
-- Table structure for dc_library_read
-- ----------------------------
DROP TABLE IF EXISTS `dc_library_read`;
CREATE TABLE `dc_library_read` (
  `id` char(50) NOT NULL COMMENT '主键',
  `name` varchar(128) DEFAULT NULL COMMENT '用户名-标记为已读时，必须要登录',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `knowledge_id` char(50) DEFAULT NULL COMMENT '知识库id',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='知识库-用户已读记录';

