COMMIT;

-- ----------------------------
-- Table structure for dc_library_user
-- ----------------------------
DROP TABLE IF EXISTS `dc_library_user`;
CREATE TABLE `dc_library_user` (
  `id` char(50) NOT NULL,
  `user_id` char(50) DEFAULT NULL COMMENT '用户ID',
  `real_name` varchar(50) DEFAULT NULL COMMENT '用户名',
  `role` enum('owner','admin','member') DEFAULT NULL COMMENT ' 权限\\所有者、管理员、成员',
  `dc_library_id` char(50) DEFAULT NULL COMMENT '知识库的ID值',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `del_flag` tinyint(1) DEFAULT '0' COMMENT '是否删除 0未删除  1已删除',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `tenant_id` char(50) DEFAULT NULL COMMENT '租户ID',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建人名称',
  `update_by` varchar(50) DEFAULT NULL COMMENT '修改人',
  `create_by_id` char(50) DEFAULT NULL COMMENT '创建者ID',
  PRIMARY KEY (`id`) USING BTREE
